    data: |
      SELECT DISTINCT - col0 * col1 + - + col2 / 11 * + - col1 + col2, + col1 + 31 * - col1 * + + col1 AS col0 FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
  - name: q13205.out
    data: |
      -1817	-13650
      -844	-203310
      11	-30
